import styled from 'styled-components';

export const Container = styled.a`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 12px;
  border: 2px solid #013c64;
  border-radius: 4px;

  div {
    margin-top: 6px;
    svg {
      margin-right: 6px;
    }
  }
`;
